sources.SetDate/style.scss:
$background: #fff;
$color: #666;
$faded: #ccc;
$accent: rgba(246, 191, 38, 1);
$highlight: rgba(254, 247, 229, 1);
$fontSize: 14px;

.component-set-date {
	background-color: $background;
	border: 1px solid $accent;
	border-radius: 3px;
	box-sizing: content-box;
	color: $color;
	font-size: $fontSize;
	height: auto;
	margin: 0 0 12px;
	width: calc(44px * 7);

	ul {
		font-size: 0;
		margin: 0;
		padding: 0;

		li {
			box-sizing: border-box;
			display: inline-block;
			font-size: $fontSize;
			line-height: 44px;
			list-style-type: none;
			margin: 0;
			padding: 0;
			position: relative;
			text-align: center;
			transition: background-color ease-in-out 0.2s;
			user-select: none;
			vertical-align: top;
			width: 44px;

			button {
				background-color: transparent;
				border: none;
				cursor: pointer;
				display: block;
				line-height: 42px;
				outline: none;
				padding: 1px 0;
				width: 100%;
			}

			&:hover {
				button {
					background-color: $highlight;
				}
			}

			&.current {
				button {
					border-bottom: 1px solid $accent;
					padding-bottom: 0;

					&::after {
						border: 5px solid transparent;
						border-right-color: $accent;
						border-bottom-color: $accent;
						content: "";
						display: block;
						height: 0;
						position: absolute;
							right: 0;
							bottom: 0;
						width: 0;
					}
				}
			}

			&.selected {
				button {
					background-color: $highlight;
					background: linear-gradient(
						135deg,
						 $highlight 20%,
						 $highlight 35%,
						 $accent 100%,
					);

				}
			}

		}
	}

	header {
		border-bottom: 1px solid $highlight;

		ul {
			display: flex;

			li {
				flex: 1 0 auto;
				font-weight: bold;

				&.prev, &.next {
					flex: 0 0 44px;
				}

				button {
					font-weight: bold;
				}
			}
		}
	}

	main {
		ul.days-of-the-week {
			border-bottom: 1px solid $highlight;
			font-size: 0;

			li {
				background: transparent;
				line-height: 28px;
			}
		}

		ul.dates {
			li {
				&.not-current-month {
					button {
						color: $faded;
					}
				}	
			}
		}

		ul.months {
			line-height: 2;

			li {
				width: 77px;
			}
		}

		ul.years {
			line-height: 2;

			li {
				width: 33.333333%;
			}
		}

		ul.time {
			display: flex;
			justify-content: center;

			li {
				color: $color;
				font-size: 24px;

				&.clockColon {
					width: auto;
				}

				&.meridiem {
					width: auto;
				}
			}
		}

		ul.timeSliders {
			display: block;
			width: 100%;

			li {
				border-top: 1px solid $highlight;
				display: flex;
				width: 100%;

				label {
					flex: 0 0 25%;
					margin-right: 10px;
					text-align: right;
				}
			}
		}
	}


	footer {
		border-top: 1px solid $highlight;

		ul {
			display: flex;

			li {
				flex: 1 0 auto;
			}
		}
	}
}

.component-set-date {
	main {
		ul.timeSliders {
			input[type="range"] {
				background: transparent; /* Otherwise white in Chrome */
				width: 100%; /* Specific width is required for Firefox. */
				-webkit-appearance: none; /* Hides the slider so that custom slider can be made */
			}

			input[type="range"]::-webkit-slider-thumb {
				-webkit-appearance: none;
			}

			input[type="range"]:focus {
				outline: none; /* Removes the blue border. You should probably do some kind of focus styling for accessibility reasons though. */
			}

			input[type="range"] {
				border: none;
				margin: 0;
				padding: 0;
				width: 192px;
			}

			input[type="range"]::-ms-track {
				cursor: pointer;
				width: 100%;

				/* Hides the slider so custom styles can be added */
				background: transparent; 
				border-color: transparent;
				color: transparent;
			}

			input[type="range"]::-webkit-slider-runnable-track {
				background: #eeeeee;
				border: none;
				border-radius: 6px;
				box-shadow: inset 0 0 3px rgba(0,0,0,0.15);
				cursor: pointer;
				width: 100%; height: 12px;
			}

			input[type="range"]::-moz-range-track {
				background: #eeeeee;
				border: none;
				border-radius: 6px;
				box-shadow: inset 0 0 3px rgba(0,0,0,0.15);
				cursor: pointer;
				width: 100%; height: 12px;
			}

			input[type="range"]::-ms-track {
				background: #eeeeee;
				border: none;
				border-radius: 6px;
				box-shadow: inset 0 0 3px rgba(0,0,0,0.15);
				color: transparent;
				cursor: pointer;
				width: 100%; height: 12px;
			}
			input[type="range"]::-ms-fill-lower {
				background: #eeeeee;
				border: none;
				border-radius: 6px;
			}
			input[type="range"]::-ms-fill-upper {
				background: #eeeeee;
				border: none;
				border-radius: 6px;
			}

			/* Special styling for WebKit/Blink */
			input[type="range"]::-webkit-slider-thumb {
				background: #333333;
				border: 2px solid #000000;
				border-radius: 50%;
				cursor: pointer;
				margin-top: 0px; /* You need to specify a margin in Chrome, but in Firefox and IE it is automatic */
				width: 12px; height: 12px;
				-webkit-appearance: none;
			}
			input[type="range"]:focus::-webkit-slider-thumb {
				background: $accent;
				border-color: $accent;
			}

			/* All the same stuff for Firefox */
			input[type="range"]::-moz-range-thumb {
				background: #333333;
				border: 2px solid #000000;
				border-radius: 50%;
				cursor: pointer;
				width: 12px; height: 12px;
			}
			input[type="range"]:focus::-moz-range-thumb {
				background: $accent;
				border-color: $accent;
			}

			/* All the same stuff for IE */
			input[type="range"]::-ms-thumb {
				background: #333333;
				border: 2px solid #000000;
				border-radius: 50%;
				cursor: pointer;
				width: 12px; height: 12px;
			}
			input[type="range"]:focus::-ms-thumb {
				background: $accent;
				border-color: $accent;
			}

			input[type="range"],
			input.range, 
			input.range ~ span.unit {
				display: inline-block;
				margin: 0 6px 0 0;
				vertical-align: middle;
			}

			input.range {
				font-size: 0.875rem;
				line-height: 1.5rem;
				padding: 0 0 0 15px;
				text-align: center;
				width: 64px;
			}

			input.range ~ span.unit {
				font-size: 0.75rem;
				line-height: 1.125rem;
			}
		}
	}
}

.component-input-date {
	position: relative;

	input[type="text"] {
		border: 1px solid $highlight;
		border-radius: 3px;
		box-sizing: border-box;
		color: $color;
		font-size: 14px;
		line-height: 32px;
		outline: none;
		padding: 0 12px;
		width: 256px;

		&::placeholder {
			color: $faded;
		}

		&:focus {
			border-color: $accent;
		}
	}

	.component-set-date {
		position: absolute;
			left: 0;
			top: 33px;
		z-index: 1;
	}
}
